import React from 'react';
import style from './RightMenu.module.css';
import Radium from 'radium';
// import { Icon } from 'react-icons-kit';

const rightMenu = () => {
    return (        
      <div className={style.RightMenu}>
          <div className={style.width + style.left}></div>
          <div className={style.width + style.mid}></div>
          <div className={style.width + style.right}></div>
      </div>
    );
}

export default Radium(rightMenu);
